import React from "react";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import Navbar from "./components/Navbar";
import Herosection from "./components/Herosection";
import "./App.css";

function App() {
  return (
    <Router>
      <nav>
      <div>
        <Navbar />
        <Herosection />
      </div>
      </nav>
    </Router>
  );
}

export default App;
